import React, {
  Text,
  View,
  Component,
  StyleSheet,
  TabBarIOS
} from 'react-native';

var AsyncStorage = require ('react-native').AsyncStorage;
var _ = require ('lodash');
var Dashboard = require('./dashboard');
var Trade = require('./trade');
var Watchlist = require('./watchlist')
var Quote = require('./quote');


var homeicon = 'data:image/png;base64,';
var watchlist = 'data:image/png;base64,'
var trade = 'data:image/png;base64,'
var search = 'data:image/png;base64,'

//var Feed = require('./feed');

class AppContainer extends Component{
  constructor(props){
    super(props);

    var Authinfo = {};

    AsyncStorage.multiGet(['userId', 'username', 'token'], (err, val)=> {
      if(err){
        return cb(err);
      }

      for(var i=0; i<val.length; i++){
        Authinfo[val[i][0]] = val[i][1];
      }

      //console.log(Authinfo);
      //Authinfo.username is username
      //Authinfo.userId is userId
      //Authinfo.token is token
    })

    console.log(this.props.info);

    this.state = {
      selectedTab: 'home',
      username: Authinfo.username,
      userId: Authinfo.userId,
      token: Authinfo.token
    }
  }

  render() {
    return (
      <TabBarIOS style={styles.container}
                  tintColor="white"
                  barTintColor="#48BBEC"
                  borderTopColor="#000">
        <TabBarIOS.Item
          title="Home"
          selected={this.state.selectedTab == 'home'}
          icon={{uri: homeicon, scale: 4}}
          onPress={()=> this.setState({selectedTab: 'home'})}
        >

          <Dashboard info={this.props.info} />
        </TabBarIOS.Item>

        <TabBarIOS.Item
          title="Watchlist"
          selected={this.state.selectedTab == 'watchlist'}
          icon={{uri: watchlist, scale: 11}}
          onPress={()=> this.setState({selectedTab: 'watchlist'})}
        >
         <Watchlist info={this.props.info} />
        </TabBarIOS.Item>

        <TabBarIOS.Item
          title="Quote"
          selected={this.state.selectedTab == 'quote'}
          icon={{uri: search, scale: 3}}
          onPress={()=> this.setState({selectedTab: 'quote'})}
        >

          <Quote info={this.props.info} />
        </TabBarIOS.Item>
        <TabBarIOS.Item
          title="Trade"
          selected={this.state.selectedTab == 'trade'}
          icon={{uri: trade, scale: 6}}
          onPress={()=> this.setState({selectedTab: 'trade'})}
        >
         <Trade info={this.props.info} />
        </TabBarIOS.Item>
      </TabBarIOS>
    )
  }

}

var styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#F5FCFF',
  },
  welcome: {
    fontSize: 20,
    textAlign: 'center',
    margin: 100
  }
});

module.exports = AppContainer;